zeer goeie en heftige film

met Sara Paxton, Monica Potter en Garret Dillahunt

John en Emma Collingwood en hun dochter Mari verblijven in een vakantiehuis in de bossen. Mari krijgt toestemming van haar 
ouders om haar vriendin Paige op te zoeken in het nabijgelegen dorp. Maar wanneer het tweetal daar in de handen van een groepje 
criminelen terechtkomt, worden ze ontvoerd...
